window.bookSummaryJSON = "<p><b>The Narthon Empire and an Iraquinik member, Kolinka, made a mistake.</b></p> <p>They tried to kill or capture Yozef Kolsko. The possibility that Caedellium could have peaceful years going forward is refuted. The key is bringing down Narthon. But how?</p> <p>Caedellium is too small, despite innovations by Yozef Kolsko (Joseph Colsco) and Mark Kaldwel (Caldwell), humans cast away on the planet Anyar. Allies are needed. Campaigns to be planned. Risks to be taken.</p> <p>For Yozef Kolsko, it means assuming roles he never imagined or believed himself capable.</p> <p>Anyar will never be the same.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
